CREATE TABLE IF NOT EXISTS "calendars" (
    "created_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "modified_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "id" SERIAL NOT NULL PRIMARY KEY,
    "google_id" VARCHAR(100) NOT NULL UNIQUE
);
COMMENT ON TABLE "calendars" IS 'The Calendar Model';
CREATE TABLE IF NOT EXISTS "events" (
    "created_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "modified_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "id" SERIAL NOT NULL PRIMARY KEY,
    "google_id" VARCHAR(100) NOT NULL UNIQUE,
    "form_id" VARCHAR(200) NOT NULL UNIQUE,
    "open_at_ts" INT NOT NULL,
    "created" BOOL NOT NULL  DEFAULT False,
    "opened" BOOL NOT NULL  DEFAULT False,
    "calendar_id" INT NOT NULL REFERENCES "calendars" ("id") ON DELETE CASCADE
);
COMMENT ON TABLE "events" IS 'The Event Model';
CREATE TABLE IF NOT EXISTS "rolemodel" (
    "created_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "modified_at" TIMESTAMPTZ   DEFAULT CURRENT_TIMESTAMP,
    "id" SERIAL NOT NULL PRIMARY KEY
);
CREATE TABLE IF NOT EXISTS "aerich" (
    "id" SERIAL NOT NULL PRIMARY KEY,
    "version" VARCHAR(255) NOT NULL,
    "app" VARCHAR(20) NOT NULL,
    "content" TEXT NOT NULL
